import React ,{useState,useEffect} from 'react';
import User from "./User";
import Palette from "./Palette";


const Profile = () => {
    
    var state = {
        name:"keanu",
        surname:"reevessss",
        src:"https://i2.wp.com/www.intelligentliving.co/wp-content/uploads/2019/09/Keanu-Reeves-1.jpg?fit=2100%2C1200&ssl=1",
        alt:"man"    
    }
    
    const{name,surname,src,alt} = state ;
    var[counter,setCounter] = useState (1) ;

    // setName="banana" ;
    useEffect (() =>{
        
        // damateba();
        // return gamokleba();
        // gamokleba();
        // return alert("me");
    }
    )
    const damateba = ()=>{
        setCounter(counter++);
    }
    const gamokleba = ()=>{
        counter<=1? counter=1 : setCounter(counter--)
        
    }
    
return(
    <div className="container profile">
        <div>counter mimdinare is{counter}</div>
        <button onClick={damateba}>+++</button>
        <button onClick={gamokleba}>---</button>
        <User src={src}
            alt={alt} 
            // name={namee}
            surname={surname}
            />
            
        <Palette/>
    </div>
    )
}

export default Profile ;
